const {
    battery,
    enumLookup,
    numeric,
	pressure,
    temperature,
	humidity,
} = require('zigbee-herdsman-converters/lib/modernExtend');



const definition = {
        zigbeeModel: ['EFEKTA_DigiBaro'],
        model: 'EFEKTA_DigiBaro',
        vendor: 'EFEKTA',
        description: 'Smart digital barometer with e-ink display.',
        icon: 'data:image/png;base64,',
		extend: [
            pressure({
                unit: 'kPa',
                description: 'Pressure in kPa',
                scale: 10,
                reporting: false,
                access: 'STATE',
            }),
            temperature({
                reporting: false,
                access: 'STATE',
            }),
			humidity({
                reporting: false,
                access: 'STATE',
            }),
            battery({
				access: 'STATE',
				percentageReportingConfig: false,
                lowStatus: true,
				voltage: false,
                voltageReporting: false,
                voltageReportingConfig: false,
            }),
			enumLookup({
                name: 'basic_data',
                lookup: {'Barometer': 0, 'T&H': 1},
                cluster: 'genPowerCfg',
                attribute: {ID: 0xF005, type: 0x20},
                description: 'Set data output on the display',
				access: 'STATE_SET',
            }),
			enumLookup({
                name: 'invert_color',
                lookup: {'BW': 0, 'WB': 1},
                cluster: 'genPowerCfg',
                attribute: {ID: 0xF004, type: 0x29},
                description: 'Set color mode',
				access: 'STATE_SET',
            }),
			numeric({
                name: 'pressure_offset',
                unit: 'hPa',
                valueMin: -50,
                valueMax: 50,
                valueStep: 1,
                cluster: 'msPressureMeasurement',
                attribute: {ID: 0x0210, type: 0x39},
                description: 'Adjust pressure',
				access: 'STATE_SET',
            }),
			numeric({
                name: 'temperature_offset',
                unit: '°C',
                valueMin: -50,
                valueMax: 50,
                valueStep: 0.1,
				precision: 1,
                cluster: 'msTemperatureMeasurement',
                attribute: {ID: 0x0210, type: 0x39},
                description: 'Adjust temperature',
				access: 'STATE_SET',
            }),
			numeric({
                name: 'humidity_offset',
                unit: '%',
                valueMin: -50,
                valueMax: 50,
                valueStep: 0.1,
				precision: 1,
                cluster: 'msRelativeHumidity',
                attribute: {ID: 0x0210, type: 0x39},
                description: 'Adjust humidity',
				access: 'STATE_SET',
            }),
        ],
    };

module.exports = definition;